function AjaxPortalUsers(){this.pageNumber=1;this.postData=null;this.setPostData=function(a){this.postData=a};this.getPostData=function(){return this.postData};this.getPageNumber=function(){return this.pageNumber};this.setPageNumber=function(a){void 0!=a&&(this.pageNumber=a)};this.ajax=function(){return $.ajax({type:"POST",url:"/adminusers/AjaxSearchPortalUsers/"+this.getPageNumber(),dataType:"json",data:this.getPostData()})};this.fetch=function(){return this.ajax()}};
